def input_fn(serialized_input_data, content_type):
    logger.info("Deserializing the input data.")
    try:
        if content_type == 'application/json':
            input_data = json.loads(serialized_input_data)
            if 'prompt' not in input_data:
                raise ValueError(
                    "Invalid input data, 'prompt' field is required.")
            words = input_data['prompt'].split()
            sequence = [vocab.get(word, vocab['<UNK>']) for word in words]
            return torch.tensor([sequence], dtype=torch.long)
        else:
            raise ValueError(
                "Unsupported content type: {}".format(content_type))
    except Exception as e:
        logger.error(f"Error in input deserialization: {e}", exc_info=True)
        raise


def generate_joke(model, sequence, vocab, reverse_vocab, max_length=50):
    generated_sequence = sequence
    for _ in range(max_length):
        input_seq = torch.tensor([generated_sequence], dtype=torch.long)
        with torch.no_grad():
            output = model(input_seq)
        next_word_idx = output[0, -1].argmax().item()
        if next_word_idx == vocab['<END>'] or next_word_idx == vocab['<UNK>']:
            break
        generated_sequence.append(next_word_idx)
    return ' '.join([reverse_vocab.get(idx, "") for idx in generated_sequence if idx != vocab['<END>'] and idx != vocab['<UNK>']])


